import React, { useState, useEffect } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';

const ProfileForm = () => {
  const [selectedGroup1, setSelectedGroup1] = useState(null); // 1-3
  const [selectedGroup2, setSelectedGroup2] = useState(null); // 4-6
  const [hasTakenNCII, setHasTakenNCII] = useState(null); // null, true, or false
  const [isFormComplete, setIsFormComplete] = useState(false);

  const navigate = useNavigate();
  const location = useLocation();

  // Update isFormComplete whenever required fields change
  useEffect(() => {
    const isNCIIAnswered = hasTakenNCII !== null; // Check if NCII question is answered
    const isGroup1Answered = selectedGroup1 !== null; // Check if Group 1 is answered
    const isGroup2Answered = selectedGroup2 !== null; // Check if Group 2 is answered

    // Set isFormComplete to true only if ALL conditions are met
    setIsFormComplete(isNCIIAnswered && isGroup1Answered && isGroup2Answered);
  }, [hasTakenNCII, selectedGroup1, selectedGroup2]);

  const handleSubmit = () => {
    if (isFormComplete) {
      navigate('/realtime'); // Navigate to /realtime
    }
  };

  return (
    <div className="container d-flex flex-column align-items-start">
      <h1 className="align-self-start mt-5 font-weight-900">Cuisining</h1>
      <h3 className="align-self-start mt-3 ml-3 font-weight-600">Customize Profile</h3>

      {/* Have you taken any NCII Cookery course? (Radio Buttons) */}
      <div>
        <h4>Have you taken any NCII Cookery course?</h4>
        <label>
          <input
            type="radio"
            name="ncii"
            value="yes"
            checked={hasTakenNCII === true}
            onChange={() => setHasTakenNCII(true)}
          />
          Yes
        </label>
        <label>
          <input
            type="radio"
            name="ncii"
            value="no"
            checked={hasTakenNCII === false}
            onChange={() => setHasTakenNCII(false)}
          />
          No
        </label>
      </div>

      {/* First Group of Radio Buttons (1-3) */}
      <div className="d-flex flex-column align-items-start mt-3">
        <h4 className="mt-3">Do you have any experience in cooking before?</h4>
        <label>
          <input
            type="radio"
            name="group1"
            value="1"
            checked={selectedGroup1 === '1'}
            onChange={() => setSelectedGroup1('1')}
          />
          Do you have experience in cooking?
        </label>
        <label>
          <input
            type="radio"
            name="group1"
            value="2"
            checked={selectedGroup1 === '2'}
            onChange={() => setSelectedGroup1('2')}
          />
          I have a bit of experience in cooking
        </label>
        <label>
          <input
            type="radio"
            name="group1"
            value="3"
            checked={selectedGroup1 === '3'}
            onChange={() => setSelectedGroup1('3')}
          />
          I have no experience at all
        </label>
      </div>

      {/* Second Group of Radio Buttons (4-6) */}
      <div className="d-flex flex-column align-items-start mt-3">
        <h4 className="mt-3">What’s your motive in learning how to cook?</h4>
        <label>
          <input
            type="radio"
            name="group2"
            value="4"
            checked={selectedGroup2 === '4'}
            onChange={() => setSelectedGroup2('4')}
          />
          School Purposes (BSHM Student, taking NCII, etc.)
        </label>
        <label>
          <input
            type="radio"
            name="group2"
            value="5"
            checked={selectedGroup2 === '5'}
            onChange={() => setSelectedGroup2('5')}
          />
          Home Cooking
        </label>
        <label>
          <input
            type="radio"
            name="group2"
            value="6"
            checked={selectedGroup2 === '6'}
            onChange={() => setSelectedGroup2('6')}
          />
          Others
        </label>
      </div>

      {/* Submit Button */}
      <div className="buttonContainer d-flex align-items-center mt-5 mb-5">
        <button
          className={`cbtn cbtn-success ml-4 ${!isFormComplete ? 'opacity-5 no-hover' : ''}`}
          disabled={!isFormComplete}
          onClick={handleSubmit}
        >
          Submit
        </button>
        <button className="cbtn cbtn-outline-secondary ml-3">Cancel</button>
      </div>
    </div>
  );
};

export default ProfileForm;
